.footer{
    background: #230834;
    position: relative;
    overflow: hidden;
    padding-bottom: 100px;
    width:calc(100% - 32px);
    padding-left: 16px;
    padding-right: 16px;
    .left{
        min-width:320px;
        .text{
            font-family: 'Inter';
            font-style: normal;
            font-weight: 500;
            font-size: 14px;
            line-height: 145.9%;
            letter-spacing: -0.015em;
            color: rgba(255, 255, 255, 0.8);

        }
    }
    .links{
        margin-top: 55px;
        a{
            text-decoration: none;
            font-family: 'Brinnan';
            font-style: normal;
            font-weight: 700;
            font-size: 16px;
            line-height: 240.4%;
            letter-spacing: -0.015em;
            color: #FFFFFF;
        }
    }
    .social{
        display: none;
    }
    .banner{
        background: #2F1143;
        position: absolute;
        bottom: 0;
        width:110%;
        left:0;
        font-family: 'Brinnan';
        font-style: normal;
        font-weight: 700;
        font-size: 16px;
        line-height: 212.9%;
        letter-spacing: -0.015em;
        color: #FFFFFF;
        padding:19px;
    }
}
